import React from 'react'

const App = (props) => {
    return (
        <div>
            <h1>App</h1>
        </div>
    )
}

export default App

export async function getServerSideProps({ req, res }){
    return {
        props: {
            user: {
                name: 'Joramir'
            }
        }
    }
}
